import React from 'react';
import { View, Text } from 'react-native';

const Profile = () => {
    return (
        <View>
            <Text>Ini adalah layar profil!</Text>
            {/* Tambahkan komponen atau logika lain yang diperlukan */}
        </View>
    );
};

export default Profile;
